window.addEventListener("load",(function(){"serviceWorker"in navigator&&navigator.serviceWorker.register("/serviceworker.js").then((function(registration){console.log("Service Worker Registered,register script: serviceworker.js.")})).catch((function(error){console.log("Registration failed with "+error)}))})),"storage"in navigator&&"estimate"in navigator.storage&&navigator.storage.estimate().then(estimate=>{console.log(`Using ${estimate.usage/1024/1024} out of ${estimate.quota/1024/1024} MB.And the proportion is ${estimate.usage/estimate.quota*100}%`)});